import Document, { Head, Main, NextScript, Html } from 'next/document';

export default class MyDocument extends Document {
    render() {
        return (
            <html>
                <head>
                    <title>Besedila pesmi akordi</title>
                    <link rel="stylesheet" href="/_next/static/style.css"/>
                </head>
                <body>
                    <Main />
                    <NextScript />
                </body>
            </html>
        )
    }
}
